<template>
    <l-map id="mapid" :zoom="zoom" :center="centerMap" @click="click">
        <l-tile-layer :url="url" :attribution="attribution"></l-tile-layer>
        <l-marker :lat-lng="marker" :icon="icon"></l-marker>
    </l-map>
</template>

<script>
import { LMap, LTileLayer, LMarker } from 'vue2-leaflet'

export default {
  name: 'OpenMapWithMarker',
  data: () => ({
    zoom: 13,
    centerMap: L.latLng(47.413220, -1.219482),
    url: 'http://{s}.tile.osm.org/{z}/{x}/{y}.png',
    attribution: '&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors',
    marker: L.latLng(47.413220, -1.219482),
    icon: L.icon({
      iconUrl: 'data:image/png;base64,',
      iconSize: [38, 58],
      iconAnchor: [22, 57],
      popupAnchor: [-3, -76]
    })
  }),
  components: { LMap, LTileLayer, LMarker },
  props: {
    center: {
      type: Object,
      default: () => ({
        lat: 47.413220,
        lng: -1.219482
      })
    }
  },
  methods: {
    click (e) {
      console.log(e)
      this.mapObject.setLatLng(e.latLng)
    }
  },
  mounted () {
    this.mapObject = L.marker(this.center);
  }
}
</script>

<style scoped>
.vue2leaflet-map {
    height: 300px;
    z-index: 0;
}
</style>
